ethers:
1. Get the total supply of APEMOS tokens
```javascript
const APEMOSContract = await ethers.getContractAt('APEMOS', 'APEMOS_CONTRACT_ADDRESS');
const totalSupply = await APEMOSContract.totalSupply();
console.log(`Total supply of APEMOS tokens:`, ethers.utils.formatUnits(totalSupply, 'ether'));
```

2. Get the balance of a user's APEMOS tokens
```javascript
const userAddress = 'USER_ADDRESS';
const userBalance = await APEMOSContract.balanceOf(userAddress);
console.log(`User's balance of APEMOS tokens:`, ethers.utils.formatUnits(userBalance, 'ether'));
```

3. Transfer APEMOS tokens from sender to recipient
```javascript
const recipient = 'RECIPIENT_ADDRESS';
const transferAmount = ethers.utils.parseEther('5'); // Example: transferring 5 APEMOS tokens
const transfer = await APEMOSContract.transfer(recipient, transferAmount);
await transfer.wait();
console.log('Transfer successful!');
```

4. Approve an amount of APEMOS tokens for another user to spend on your behalf
```javascript
const spender = 'SPENDER_ADDRESS';
const approvalAmount = ethers.utils.parseEther('10'); // Example: approving 10 APEMOS tokens
const approveTx = await APEMOSContract.approve(spender, approvalAmount);
await approveTx.wait();
console.log('Approval successful!');
```

5. Transfer APEMOS tokens on behalf of another user (requires approval)
```javascript
const sender = 'SENDER_ADDRESS';
const recipient = 'RECIPIENT_ADDRESS';
const transferAmount = ethers.utils.parseEther('5'); // Example: transferring 5 APEMOS tokens on behalf of the sender
const transferFromTx = await APEMOSContract.transferFrom(sender, recipient, transferAmount);
await transferFromTx.wait();
console.log('Transfer on behalf successful!');
```

6. Get the allowance of APEMOS tokens approved by one user for another
```javascript
const ownerAddress = 'OWNER_ADDRESS';
const spenderAddress = 'SPENDER_ADDRESS';
const allowance = await APEMOSContract.allowance(ownerAddress, spenderAddress);
console.log(`Allowance:`, ethers.utils.formatUnits(allowance, 'ether'));
```

7. Increase the allowance of APEMOS tokens for a spender
```javascript
const spender = 'SPENDER_ADDRESS';
const increaseAmount = ethers.utils.parseEther('5'); // Example: increasing allowance by 5 APEMOS tokens
const increaseAllowanceTx = await APEMOSContract.increaseAllowance(spender, increaseAmount);
await increaseAllowanceTx.wait();
console.log('Allowance increased!');
```

8. Decrease the allowance of APEMOS tokens for a spender
```javascript
const spender = 'SPENDER_ADDRESS';
const decreaseAmount = ethers.utils.parseEther('3'); // Example: decreasing allowance by 3 APEMOS tokens
const decreaseAllowanceTx = await APEMOSContract.decreaseAllowance(spender, decreaseAmount);
await decreaseAllowanceTx.wait();
console.log('Allowance decreased!');
```

